import styles from './Home.module.css'



function Home() {
  return (
    <section className={styles.home_container}>
      <h1>
        <span>Erika</span>
      </h1>
      <p>Aqui vai ficar a foto e algumas explicações</p>
    </section>
  )
}

export default Home
